import styled from "styled-components";
import { containerStyle } from "../../assets/styles";

export default {
  Container: styled.div`
    ${containerStyle}
  `,
  Switcher: styled.div`
    display: flex;
    flex-direction: row;
  `,
  Button: styled.button`
    padding: 19px 0px;
    width: 50m;
  `,
};
